import React, { useState }  from 'react';

const Events =() =>{

      const purple ="#8e44ad";
    const[bg,setBg] =useState(purple);

    const bgChange =() =>

    {
       let newBg = '#34495e';
       setBg(newBg);
        
    };

    return(
        <>
        <div style={{backgroundColor:"bg"}}>
            <button onClick={bgChange}> CLICK ME</button>
        </div>
        </>

    );
};

export default Events;
